                               Caracter\\u00edsticas\\n\\n\\u00b7 As decis\\u00f5es estrat\\u00e9gicas s\\u00e3o tomadas no n\\u00edvel mais alto da organiza\\u00e7\\u00e3o e t\\u00eam um impacto significativo em toda a\\n empresa. Elas s\\u00e3o feitas pelos principais l\\u00edderes e influenciam toda a organiza\\u00e7\\u00e3o\\n\\u00b7 Ela define a vis\\u00e3o de longo prazo da empresa, estabelecendo a dire\\u00e7\\u00e3o que a empresa deseja seguir e as iniciativas \\nnecess\\u00e1rias para atingir esse futuro desejado\\n\\u00b7 Envolve tamb\\u00e9m uma an\\u00e1lise do ambiente interno e externo da empresa, permitindo a identifica\\u00e7\\u00e3o de pontos fortes,\\nbem como das oportunidades e amea\\u00e7as no mercado\\n\",\"underline\":false,\"overline\":false,\"linethrough\":false,\"textAlign\":\"left\",\"fontStyle\":\"normal\",\"lineHeight\":1.16,\"textBackgroundColor\":\"\",\"charSpacing\":0,\"styles\":[],\"direction\":\"ltr\",\"path\":null,\"pathStartOffset\":0,\"pathSide\":\"left\",\"id\":\"object_51dmg823q\"},\"object_5v82icdem\":{\"type\":\"path\",\"version\":\"4.6.0\",\"originX\":\"left\",\"originY\":\"top\",\"left\":229.72,\"top\":416.39,\"width\":375.57,\"height\":4.44,\"fill\":null,\"stroke\":\"black\",\"strokeWidth\":5,\"strokeDashArray\":null,\"strokeLineCap\":\"round\",\"strokeDashOffset\":0,\"strokeLineJoin\":\"round\",\"strokeUniform\":false,\"strokeMiterLimit\":10,\"scaleX\":1,\"scaleY\":1,\"angle\":0,\"flipX\":false,\"flipY\":false,\"opacity\":1,\"shadow\":null,\"visible\":true,\"backgroundColor\":\"\",\"fillRule\":\"nonzero\",\"paintFirst\":\"fill\",\"globalCompositeOperation\":\"source-over\",\"skewX\":0,\"skewY\":0,\"id\":\"object_5v82icdem\",\"path\":[[\"M\",232.21722222222223,418.8888761732314],[\"Q\",232.22222222222223,418.8888761732314,232.77777777777777,419.4444317287869],[\"Q\",233.33333333333334,419.99998728434247,233.8888888888889,419.99998728434247],[\"Q\",234.44444444444446,419.99998728434247,235,419.99998728434247],[\"Q\",235.555